import { Tab } from "bootstrap";
import React from "react";
import Table from "react-bootstrap/Table";

const VolunteerTable = () => {
  return (
    <Table striped bordered hover>
      <thead>
        <tr>
          <th>id</th>
          <th>name</th>
          <th>lang</th>
        </tr>
      </thead>
    </Table>
  );
};

export default VolunteerTable;
